import React, { useState } from 'react';
import './EmailVerification.css';

const EmailVerification = () => {
  const [otp, setOtp] = useState(['', '', '', '', '']);
  const [errors, setErrors] = useState({});

  const handleOtpChange = (index, value) => {
    if (value.length <= 1 && /^\d*$/.test(value)) {
      const newOtp = [...otp];
      newOtp[index] = value;
      setOtp(newOtp);

      // Auto-focus next input
      if (value && index < 4) {
        const nextInput = document.getElementById(`otp-${index + 1}`);
        if (nextInput) nextInput.focus();
      }
    }
  };

  const handleKeyDown = (index, e) => {
    if (e.key === 'Backspace' && !otp[index] && index > 0) {
      const prevInput = document.getElementById(`otp-${index - 1}`);
      if (prevInput) prevInput.focus();
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const otpString = otp.join('');

    if (otpString.length !== 5) {
      setErrors({ otp: 'Please enter the complete OTP' });
      return;
    }

    // Handle verification logic here
    console.log('OTP verification:', otpString);
    // You can add your verification logic here
  };

  const handleResendCode = () => {
    console.log('Resending code...');
    // You can add your resend logic here
  };

  return (
    <div className="email-verification-page">
      <div className="verification-container">
        {/* Left Panel - Form */}
        <div className="form-panel">
          <div className="form-header">
            <h1 className="page-title">Email Verification</h1>
            <div className="login-link-top">
              Already have an account? <a href="/login">Log in</a>
            </div>
          </div>

          <div className="form-content">
            <h2 className="section-title">Verify Email Address</h2>
            <p className="section-subtitle">Enter OTP</p>

            <form className="verification-form" onSubmit={handleSubmit}>
              <div className="otp-container">
                {otp.map((digit, index) => (
                  <input
                    key={index}
                    id={`otp-${index}`}
                    type="text"
                    maxLength="1"
                    value={digit}
                    onChange={(e) => handleOtpChange(index, e.target.value)}
                    onKeyDown={(e) => handleKeyDown(index, e)}
                    className="otp-input"
                    placeholder="•"
                  />
                ))}
              </div>

              {errors.otp && <span className="error-message">{errors.otp}</span>}

              <div className="otp-instructions">
                <span className="instruction-text">Enter code sent to your email</span>
                <a href="/signup" className="different-email-link">Use a different email</a>
              </div>

              <button type="submit" className="verify-btn">
                Verify
              </button>
            </form>

            <div className="resend-section">
              <button 
                type="button" 
                className="resend-link"
                onClick={handleResendCode}
              >
                Didn't receive code? Resend code
              </button>
            </div>
          </div>
        </div>

        {/* Right Panel - Cityscape Image */}
        <div className="visual-panel">
          <div className="cityscape-image">
            {/* This would be your Singapore cityscape image */}
            <div className="image-placeholder">
              <div className="cityscape-content">
                <h3>Singapore</h3>
                <p>Marina Bay Sands • Marina Bay</p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default EmailVerification;
